// this is where json file data from porjects comes in. Reusable component// dont forget to import it
// render six instances of projectgallery projects
import React from "react";
import Layout from "../components/Layout";
import projectData from "../details.json";
import Card from "react-bootstrap/Card";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";

const Projects = () => {
  console.log(typeof projectData);
  return (
    <div>
      <Layout>
        <Row xs={1} md={2} className="g-4">
          {projectData.map((project) => (
            <Col>
              <Card key={project.id}>
                <Card.Img
                  style={{ width: "200px" }}
                  variant="top"
                  src={process.env.PUBLIC_URL + "/" + project.projectImage}
                  alt="show"
                />
                <Card.Body>
                  <Card.Title>Card title</Card.Title>
                  <Card.Text>
                    This is a longer card with supporting text below as a
                    natural lead-in to additional content. This content is a
                    little bit longer.
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Layout>
    </div>
  );
};

export default Projects;

